import React, { useState } from "react";

const PersonalityForm = () => {
  const [name, setName] = useState("");

  return (
    <div>
      <h2>Personality Form</h2>
      <label>
        Your Name:
        <input
          type="text"
          placeholder="Enter your name"
          value={name}
          onChange={(e) => setName(e.target.value)}
        />
      </label>
    </div>
  );
};

export default PersonalityForm;
